import React from 'react';

function Home() {
  return (
    <div>
      <header style={{ backgroundColor: '#282c34', padding: '20px', color: 'white', textAlign: 'center' }}>
        <h1>Welcome to Shuda's Website</h1>
      </header>
      <main style={{ textAlign: 'center', marginTop: '50px' }}>
        <h2>My Portfolio</h2>
      </main>
    </div>
  );
}

export default Home;
